import React from 'react'
import Logo from "../../assets/logo.png"

function Header () {
  return (
    <header>
    <h1>Portfolio Morgane</h1>
    <img
      src={Logo}
      alt="portfolio-de-morgane"
      className="logo_morgane"
      height={68}
      width={201}
    />
    </header>
  );
}

export default Header
